import React from 'react'
import '../pages-styles/home.css'
import Navbar from '../component/Navbar';
import Footer from '../component/Footer';
import ProjectsCard from '../component/Projects-Card';
function Home () {
  return (
    <>
    <Navbar/>
    <ProjectsCard/>
    <Footer/>
    </>
    
  )
}

export default Home;
